  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100523 contains 258 temperature
  profiles collected from Expendable Bathythermographs (XBT) aboard the Safmarine
  Meru in the Pacific Ocean, Coral Sea, and Solomon Sea from 27 October 2012 to 5
  November 2012. These data were collected by Dr. Dean Roemmich of Scripps Institution
  of Oceanography (SIO) on the PX05 transect as part of the High Resolution XBT Network.
  The data were then submitted by Lisa Lehmann of SIO.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
